import logo from './logo.svg';
import './App.css';
import './telas/jogos';
import {BrowserRouter as Router, Route, Routes, Link} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h3>Bingo do Medo</h3>
          <a>
            <Link to='/jogos'>Bingo de Jogos</Link>
          </a>
          <a>
            <Link to='/curta'>Bingo de Curtas</Link>
          </a>
        </header>
        <Routes className="routes">
            <Route path="/" element={<jogos />} />
            <Route path="/jogos" element={<jogos />} />
            <Route path="/curta" element={<curtas />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
